import{_ as i}from"./plugin-vue_export-helper-c27b6911.js";import{o as a,c as o,a as e}from"./app-21243f18.js";const d={},t=e('<h1 id="卸载windows服务-删除-windows-服务" tabindex="-1"><a class="header-anchor" href="#卸载windows服务-删除-windows-服务" aria-hidden="true">#</a> 卸载windows服务，删除 windows 服务</h1><h2 id="方法-步骤" tabindex="-1"><a class="header-anchor" href="#方法-步骤" aria-hidden="true">#</a> 方法/步骤</h2><ol><li><p>1</p><p>windows提供了基于命令窗口删除服务的功能，就是在命令窗口输入</p><p><strong>sc delete 服务名称</strong></p><p>在窗口输入上面的命令就能删除了。下面详细说明。</p></li><li><p>2</p><p><strong>确定&quot;服务名称&quot;</strong>，&quot;服务名称&quot;并不是我们在服务列表里直接看到的名称，我们看到的是服务的&quot;显示名称&quot;,查看服务名称的方法，就是在要删除的服务上右击，选择&quot;属性&quot;，这时就能看到真正的&quot;服务名称&quot;。比如下面的例子我们要删除“SQL Server Browser”服务，其真实的服务名称为“SQLBrowser”</p><figure><img src="https://gh.xlc520.tk/xlc520/MyImage/raw/main/MdImg/d9a8d2d2bb665159594c639f8fe23ea23b42c7a1.jpg" alt="怎么卸载windows服务，删除 windows 服务" tabindex="0" loading="lazy"><figcaption>怎么卸载windows服务，删除 windows 服务</figcaption></figure><figure><img src="https://gh.xlc520.tk/xlc520/MyImage/raw/main/MdImg/116b1ae23ea23a424176d3a53733ec3835bbc0a1.jpg" alt="怎么卸载windows服务，删除 windows 服务" tabindex="0" loading="lazy"><figcaption>怎么卸载windows服务，删除 windows 服务</figcaption></figure></li><li><p>3</p><p><strong>执行”sc delete 服务名称“</strong>，打开命令窗口，输入 ”sc delete &quot;+刚才查看到的服务名称，回车就会提示删除成功。这里我们输入 <code>sc delete SQLBrowser</code> ，提示删除成功后，在服务窗口列表里也删除掉了。</p><figure><img src="https://gh.xlc520.tk/xlc520/MyImage/raw/main/MdImg/a151a233ec3834bbffe3d1ea8714c27bd3823da6.jpg" alt="怎么卸载windows服务，删除 windows 服务" tabindex="0" loading="lazy"><figcaption>怎么卸载windows服务，删除 windows 服务</figcaption></figure><figure><img src="https://gh.xlc520.tk/xlc520/MyImage/raw/main/MdImg/0d55dc7bd28286894d4ac40465f97fbd4d7c37a6.jpg" alt="怎么卸载windows服务，删除 windows 服务" tabindex="0" loading="lazy"><figcaption>怎么卸载windows服务，删除 windows 服务</figcaption></figure><figure><img src="https://gh.xlc520.tk/xlc520/MyImage/raw/main/MdImg/7efc527c34b33c41c0b6a0f4887de137c8762ea6.jpg" alt="怎么卸载windows服务，删除 windows 服务" tabindex="0" loading="lazy"><figcaption>怎么卸载windows服务，删除 windows 服务</figcaption></figure></li></ol>',3),n=[t];function s(c,w){return a(),o("div",null,n)}const l=i(d,[["render",s],["__file","删除 windows 服务.html.vue"]]);export{l as default};
